Il monitoraggio delle funzioni vitali è un importante componente dell’anestesia e il suo potenziamento nella pratica anestesiologica consente di elevare la sicurezza dell’anestesia migliorando il livello di assistenza del paziente.
L’app Mia è uno strumento veloce e di facile consultazione che contiene i video tutorial delle principali procedure da impiegare nel paziente durante l’anestesia secondo i criteri di sorveglianza clinica e strumentale stabiliti dalle Linee Guida Siaarti.

Realizzata in collaborazione con l’Ospedale Monaldi di Napoli, l’app è stata sviluppata per essere fruibile in sala operatoria:
•	contiene 16 procedure con 16 video tutorial per la misurazione dei parametri ANALGESIA, TEMPERATURA CORPOREA, MIORISOLUZIONE, IPNOSI, EMODINAMICA;
•	è utilizzabile anche offline;
•	contiene i riferimenti alle Linee Guida «Buone Pratiche Cliniche SIAARTI» e i link per la loro consultazione completa;
•	registra la procedura effettuata e rilascia un documento pdf da poter esportare e allegare alla cartella clinica del paziente, in modo anonimo.
